####################################################################################
[quad_gantry_level]
gantry_corners:                    		                          ; 300mm machineries
	-60,-10
	360,370
##	Probe points                   		                            
points:
	50,25                   	   	                              
	50,225                   	   	                              
	250,225                   	   	                              
	250,25                   	   	                              

speed: 200                                                       ; The speed (in mm/s) of non-probing moves during the calibration. The default is 50.
